from math import *
import functools
class Solution:
    def minBuildTime(self, blocks, split: int) -> int:
        blocks.sort()
        functools.lru_cache(None)
        def dfs(works, start, end):
            if works >= end - start:
                return blocks[end - 1]
            if works == 1:
                return dfs(works * 2, start, end) + split

            T = (end - start - 1) // (works - 1)
            TS = log2(T)
            if 2 ** TS < T:
                TS += 1
            if blocks[end - 1] > ( split * TS + blocks[end - 2]):
                return blocks[end - 1]



            CaseA = dfs(works - 1, start, end - 1)
            if blocks[end - 1] >= CaseA:
                return blocks[end - 1]
            CaseB = dfs(works * 2, start, end) + split
            return min(CaseA, CaseB)

        return dfs(1, 0, len(blocks))

